INSERT INTO project_details (project_id, pdf_file, Title, Authors, Publication_Year, Major, Keywords, Abstract, generated_imrad) VALUES
(1, , 'NumWorld', 'Mary Joy H. Rencio', '2023', 'IST', 'secret', 'di ko knows', 'This gamified learning application, NumWorld, provides users with an interactive and engaging experience in understanding the four most common number system types: decimals, binary, octal, and hexadecimal. Users can explore these systems through various instructional materials, including reading materials, video tutorials, and hands-on activities. They can also test their knowledge through quizzes and aim for the top spot on the leaderboard, fostering a competitive and motivating learning environment. The gamified approach effectively addresses the challenges faced by many students in learning number systems by incorporating engaging features like leaderboards, badges, and points. This encourages active participation and deeper understanding by integrating real-world events and problem-solving.nnNumWorld's development follows the Software Development Waterfall Model, ensuring a structured and systematic process from analysis to deployment. The project is divided into distinct phases, each focusing on specific aspects like requirements analysis, system design, coding, testing, and maintenance. The requirements analysis phase meticulously identifies and documents the necessary features, including the types of number systems to be covered, instructional materials, and gamification elements. System and program design phases focus on user interface prototypes and system architecture, ensuring seamless navigation and engaging current_user experiences.nnThe development team carefully codes and tests each component during the coding and unit testing phase.  The integration and system testing phase ensures the smooth integration of various components and features, while usability loop testing assesses the current_user experience and security measures. The final stage, operation and maintenance, involves ongoing monitoring and maintenance to ensure the application's smooth operation. This includes addressing issues and bugs promptly and implementing updates or enhancements based on user feedback. The development team has also implemented supporting process plans, such as configuration management and verification and validation plans, to ensure the project remains on track and meets the specified requirements. nnNumWorld's current_user interface is designed to be intuitive and engaging, with a focus on interactive elements and visual aids. The application's effectiveness is validated through rigorous testing, which includes system testing, component testing, integration testing, and acceptance testing. These tests ensure that the application meets all functional and non-functional requirements and provides a smooth and engaging learning experience. User feedback, collected through surveys and interviews, provides valuable insights for further enhancements and improvements to the application. n');
INSERT INTO project_details (project_id, pdf_file, Title, Authors, Publication_Year, Major, Keywords, Abstract, generated_imrad) VALUES
(2, , 'Automated System Monitoring and  Notification With Swatch', ' Stephen E. Hansen & E. Todd Atkins', '2021', 'SE', 'hehe', ' This paper describes an approach to monitoring events on a large number of servers andrn workstations. While modern UNIX systems are capable of logging a variety of informationrn concerning the health and status of their hardware and operating system software, they arern generally not configured to do so. Even when this information is logged, it is often hidden inrn places that are either not monitored regularly or are susceptible to deletion or modification byrn a successful intruder. Also, a system administrator must often monitor several, perhapsrn dozens, of systems. To address these problems, our approach begins with the modification ofrn certain system programs to enhance their logging capabilities. In addition, our approach callsrn for the logging facilities on each of these systems to be configured in such a way as to sendrn a copy of the critical system and security related information to a dependable, secure, centralrn logging host system. As one might expect, this central log can see a megabyte or more ofrn data in a single day. To keep a system administrator from being overwhelmed by a largern quantity of data we have developed an easily configurable log file filter/monitor, calledrn swatch. Swatch monitors log files and acts to filter out unwanted data and take one or morern user specified actions (ring bell, send mail, execute a script, etc.) based upon patterns in thern log.', 'This paper explores the challenges of monitoring events on a large number of servers and workstations within a UNIX environment.  Traditional UNIX systems, while capable of logging various information about their health and status, often lack proper configuration and leave this crucial data vulnerable to deletion or modification by intruders. Furthermore, system administrators typically oversee numerous systems, making manual monitoring a time-consuming and error-prone task. To tackle these issues, the authors propose a multi-faceted approach. First, they enhance the logging capabilities of certain system programs, particularly focusing on security-related activities. Second, they advocate for centralizing log information by forwarding critical system and security logs from each server to a dedicated, secure central logging host, known as the LOGMASTER. The central log, however, can generate a vast amount of data, posing a challenge for administrators to sift through. To address this, the authors introduce Swatch, a configurable log file filter/monitor, designed to filter out unwanted data and execute user-specified actions based on patterns in the log.nnSwatch's design prioritizes ease of /* set schema 'and' */ configurability, aiming to be current_user-friendly for system administrators. It provides a simple set of actions, allowing users to their own actions and utilize portions of the input as arguments for those actions. Furthermore, Swatch is recongurable on demand or at specified intervals without the need for manual restarts. The core of Swatch's functionality relies on expression matching, utilizing the Perl language for its flexibility and familiarity among system administrators. Swatch consists of three main components: a configuration file, a library of actions, and a controlling program. The configuration file defines patterns and corresponding actions, allowing users to tailor Swatch to their specific monitoring needs. Swatch supports a range of actions, including echoing messages, sending bell signals, ignoring specific lines, sending mail, piping data to other commands, and executing commands. The controlling program manages the execution of the watcher process, which is responsible for real-time monitoring and action execution. nnThe authors demonstrate Swatch's capabilities through two real-world examples. The first example illustrates the /* set schema 'of' */ Swatch for continuous monitoring of high-priority events, such as system crashes, reboots, and "file system full" messages. The second example showcases a personalized Swatch configuration file used for individual monitoring tasks, tailored to the administrator's preferences and responsibilities. Swatch has proven invaluable in detecting intruders, preventing system failures, and optimizing monitoring processes.  While the authors acknowledge the need to further improve logging capabilities in additional system utilities, they believe Swatch is a powerful tool that can significantly enhance system monitoring and security within a UNIX environment. n');



